"use client"

import { useState, useEffect } from "react"
import { useAuth } from "../contexts/AuthContext"
import { useNavigate } from "react-router-dom"
import { fetchUniversityData } from "../services/universityService"
import { Link } from "react-router-dom"

export default function Profile() {
  const { currentUser, updateUser, logout } = useAuth()
  const navigate = useNavigate()
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState("")
  const [bookmarkedUniversities, setBookmarkedUniversities] = useState([])
  const [editMode, setEditMode] = useState(false)
  const [formData, setFormData] = useState({
    username: "",
    email: "",
  })

  useEffect(() => {
    if (!currentUser) {
      navigate("/login")
      return
    }

    setFormData({
      username: currentUser.username,
      email: currentUser.email,
    })

    const loadBookmarkedUniversities = async () => {
      try {
        const data = await fetchUniversityData()
        const bookmarked = data.filter(university => 
          currentUser.bookmarks.includes(university.id)
        )
        setBookmarkedUniversities(bookmarked)
      } catch (err) {
        setError("Failed to load bookmarked universities")
      } finally {
        setLoading(false)
      }
    }

    loadBookmarkedUniversities()
  }, [currentUser, navigate])

  const handleInputChange = (e) => {
    const { name, value } = e.target
    setFormData(prev => ({
      ...prev,
      [name]: value
    }))
  }

  const handleSubmit = (e) => {
    e.preventDefault()
    setError("")

    if (!formData.username || !formData.email) {
      setError("Please fill in all fields")
      return
    }

    const updatedUser = {
      ...currentUser,
      username: formData.username,
      email: formData.email
    }

    if (updateUser(updatedUser)) {
      setEditMode(false)
    } else {
      setError("Failed to update profile")
    }
  }

  const handleLogout = () => {
    logout()
    navigate("/")
  }

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
        <div className="max-w-7xl mx-auto">
          <div className="text-center">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto"></div>
            <p className="mt-4 text-gray-600">Loading profile...</p>
          </div>
        </div>
      </div>
    )
  }

  return (
    <div className="min-h-screen bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <div className="bg-white shadow rounded-lg overflow-hidden">
          <div className="px-4 py-5 sm:px-6">
            <h3 className="text-lg leading-6 font-medium text-gray-900">
              User Profile
            </h3>
            <p className="mt-1 max-w-2xl text-sm text-gray-500">
              Manage your account information and bookmarks
            </p>
          </div>

          <div className="border-t border-gray-200 px-4 py-5 sm:px-6">
            {error && (
              <div className="mb-4 bg-red-50 border border-red-200 text-red-600 px-4 py-3 rounded">
                {error}
              </div>
            )}

            <div className="grid grid-cols-1 gap-6 sm:grid-cols-2">
              <div>
                <h4 className="text-lg font-medium text-gray-900 mb-4">
                  Account Information
                </h4>
                {editMode ? (
                  <form onSubmit={handleSubmit} className="space-y-4">
                    <div>
                      <label htmlFor="username" className="block text-sm font-medium text-gray-700">
                        Username
                      </label>
                      <input
                        type="text"
                        name="username"
                        id="username"
                        value={formData.username}
                        onChange={handleInputChange}
                        className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm py-2 px-3 focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                      />
                    </div>
                    <div>
                      <label htmlFor="email" className="block text-sm font-medium text-gray-700">
                        Email
                      </label>
                      <input
                        type="email"
                        name="email"
                        id="email"
                        value={formData.email}
                        onChange={handleInputChange}
                        className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm py-2 px-3 focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                      />
                    </div>
                    <div className="flex space-x-3">
                      <button
                        type="submit"
                        className="inline-flex justify-center py-2 px-4 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
                      >
                        Save Changes
                      </button>
                      <button
                        type="button"
                        onClick={() => setEditMode(false)}
                        className="inline-flex justify-center py-2 px-4 border border-gray-300 shadow-sm text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
                      >
                        Cancel
                      </button>
                    </div>
                  </form>
                ) : (
                  <div className="space-y-4">
                    <div>
                      <p className="text-sm font-medium text-gray-500">Username</p>
                      <p className="mt-1 text-sm text-gray-900">{currentUser.username}</p>
                    </div>
                    <div>
                      <p className="text-sm font-medium text-gray-500">Email</p>
                      <p className="mt-1 text-sm text-gray-900">{currentUser.email}</p>
                    </div>
                    <button
                      onClick={() => setEditMode(true)}
                      className="inline-flex justify-center py-2 px-4 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
                    >
                      Edit Profile
                    </button>
                  </div>
                )}
              </div>

              <div>
                <h4 className="text-lg font-medium text-gray-900 mb-4">
                  Bookmarked Universities
                </h4>
                {bookmarkedUniversities.length > 0 ? (
                  <div className="space-y-4">
                    {bookmarkedUniversities.map((university) => (
                      <div
                        key={university.id}
                        className="border rounded-lg p-4 hover:bg-gray-50"
                      >
                        <h5 className="text-sm font-medium text-gray-900">
                          {university.name}
                        </h5>
                        <p className="mt-1 text-sm text-gray-500">
                          {university.location}
                        </p>
                        <Link
                          to={`/university/${university.id}`}
                          className="mt-2 inline-flex items-center text-sm text-blue-600 hover:text-blue-500"
                        >
                          View Details
                          <svg
                            className="ml-1 h-4 w-4"
                            fill="none"
                            stroke="currentColor"
                            viewBox="0 0 24 24"
                          >
                            <path
                              strokeLinecap="round"
                              strokeLinejoin="round"
                              strokeWidth={2}
                              d="M9 5l7 7-7 7"
                            />
                          </svg>
                        </Link>
                      </div>
                    ))}
                  </div>
                ) : (
                  <p className="text-sm text-gray-500">
                    You haven't bookmarked any universities yet.
                  </p>
                )}
              </div>
            </div>

            <div className="mt-6">
              <button
                onClick={handleLogout}
                className="inline-flex justify-center py-2 px-4 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-red-600 hover:bg-red-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-red-500"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}
